import { BrowserRouter as Router, Route, Switch } from "react-router-dom"
import * as ROUTES from "./constants/routes"
import Home from "./pages/home"

export default function App() {
  return (
    <Router>
      <Route exact path={ROUTES.HOME}>
       <Home />
      </Route>
    </Router>
  )
}
